import {CSS} from '../constants';

const cssStyleSheet = `
body, html {
    font-family: Montserrat, Arial, 'sans-serif';
}

.rtl {
  direction: rtl;
}

.ltr {
  direction: ltr;
}

span.tel, p.tel, div.tel {
  direction: ltr !important;
  display: inline-block;
}
`;

const cssFonts = `
@font-face {
  font-family: 'Montserrat';
  font-style: normal;
  src: local('Montserrat-Regular'), url(data:font/ttf;base64,)
  format('truetype');
}
@font-face {
  font-family: 'Montserrat';
  font-style: normal;
  font-weight: 700;
  src: local('Montserrat-Bold'), url(data:font/ttf;base64,)
  format('truetype');
}

`;
function parseContent(content, platform) {
    if (platform === 'ios') {
        return content;
    } else {
        // links starting with "/" gives about:blank in Android webview
        let regExp = new RegExp('href="/', 'g');
        return content.replace(regExp, 'href="##');
    }
}
export function wrapHtmlContent(content, language, title = null, theme = 'light', platform) {
    language = language || 'en';

    let parsedContent = parseContent(content, platform);

    let titleHtml = title || false ? `<h2>${title}</h2>` : '';
    let direction = ['ar', 'fa'].indexOf(language) > -1 ? 'rtl' : 'ltr';
    return `
    <html>
    <head>
    <style>
        ${cssFonts}
        ${cssStyleSheet}
        ${CSS}
    </style>
    </head>
    <body class="${direction} language-${language} general-info-item-content">
        ${titleHtml}
        ${parsedContent}
    </body>
    </html>
    `;
}
